cy.xpath('//*[@id="menu-toggle"]').click();
cy.get('#sidebar-wrapper > ul').children().should('have.length', 6);
cy.url().then(entryUrl => {
  cy.log(entryUrl);
  cy.xpath('//*[@id="menu-toggle"]').click();
